import React from "react";


export default function Sell() {
    return (
        <div className="min-h-screen bg-emerald-50 p-8">
            <div className="max-w-4xl mx-auto bg-white rounded-2xl shadow-lg p-8">
                <h1 className="text-3xl font-bold text-emerald-600">Sell Crops</h1>
                <p className="mt-4 text-gray-700">Create a listing to sell your produce. Add price, quantity and contact info.</p>
            </div>
        </div>
    );
}
